import '../CSS/Profile.css'; // Make sure to link your CSS file

const Profile = () => {
  // Placeholder functions for handling events
  const handleEditAvatar = () => { console.log('Edit avatar clicked'); };
  const handleToggleSwitch = () => { console.log('Toggle switch changed'); };

  return (
    <div className="profile-container">
      <header className="profile-header">
        <h1> Profile</h1>
      </header>
      <section className="profile-picture-section">
        <img src="..images/image1.jpg" alt="Profile Picture" className="profile-picture" />
        <button onClick={handleEditAvatar}>Edit Profile picture</button>
      </section>
      <div className="profile-info">
        <label>Name</label>
        <div>Abu Ehsan</div>
        <label>Username</label>
        <div>abuehsan5</div>
        <label>e-mail</label>
        <div>abutalha2814@gmail.com</div>
        <label>Address</label>
        <div>10 Paul Close, E15 4QE</div>
        <label>Phone No</label>
        <div>1234567890</div>
       
      </div>
    </div>
  );
};

export default Profile;
